import { Route, Switch } from "react-router-dom";

import Welcome from "./components/pages/Welcome";

function App() {
  return (
    <div>
      <Switch>
        <Route path="/" exact></Route>
        <Route path="/welcome">
          <Welcome />
        </Route>
      </Switch>
    </div>
  );
}

export default App;
